import React from 'react';
import './VideoItem.css'

const VideoItem = ({ video }) => {
    return ( 
        <div className="item">
        <img className="ui image" src={video.snippet.thumbnails.medium.url} alt=' '/>
        <div className="content">

        </div>
    {video.snippet.title}
    </div>
    )
}

export default VideoItem
